import React from 'react'
import { Form, Card, Button } from 'react-bootstrap'

export default function Login() {



    return(
        <>
                    <h2 className='text-center mb-4 '>Log In</h2> 
                    <Form>
                        <Button variant='success' type='submit'>Submit</Button>
                    </Form>
        </>
    )
}
